# https://leetcode.com/problems/find-the-difference/
# easy

def findTheDifference(s, t):
    """
    :type s: str
    :type t: str
    :rtype: str
    """
    set1 = set(s)
    set2 = set(t)
    diff = set2-set1

    if set1 == set2:
        for el in t:
            if t.count(el) > s.count(el):
                return el

    return list(diff)[0]


def test():
    s = ""
    t = ""
    assert findTheDifference(s, t) == 't'

    s = 'ba'
    t = 'aba'
    assert findTheDifference(s, t) == 'a'

    s = "abcd"
    t = "abcde"
    assert findTheDifference(s, t) == 'e'

    s = ""
    t = "e"
    assert findTheDifference(s, t) == 'e'


if __name__ == '__main__':
    test()